import { useEffect } from "react";

export const useGetProjects = () => {
  const fetchData = () => {
    fetch("localhost:1337/api/portfolioprojects/1?populate=*")
      .then((res) => res.json)
      .then((data) => {
        console.log(data);
      })
      .catch((error) => console.log(error));
  };

  useEffect(() => {
    fetchData();
  });
};
